  function home(req, router) {
    let counter2 = { atention: 0, interest: 0, desire: 0, action: 0, leavingapp: 0, leavedapp: 0 };
    let template = `
    <page-header id="header"></page-header>
    <hero-banner id="attention"></hero-banner>
    <image-text id="interest"></image-text>
    <text-columns id="desire"></text-columns>
    <image-banner id="action"></image-banner>
    <cta-banner id="cta"></cta-banner>
    <multi-slider id="slider"></multi-slider>
    <page-footer id="footer"></page-footer>
    <form-appoinment id="appoinment"></form-appoinment>
    `;
    let currentValue2 = store.getState();
    home_default.context = currentValue2.context;
    document.documentElement.setAttribute("data-theme", home_default.context.theme);
    page = new AppPage(home_default, template);
    const pageEvents = {
      handleEvent: (e2) => {
        switch (e2.type) {
          case "user:select-lang":
            store.dispatch(setLanguaje(e2.detail));
            break;
          case "user:select-theme":
            store.dispatch(setTheme(e2.detail));
            break;
          case "app-click":
            switch (e2.detail.source) {
              case "appoinment-button":
                store.dispatch(setStage("action/open"));
                break;
                break;
            }
          case "date-selected":
            let calendar = home_default.props.components.find((el) => el.id === "appoinment").calendar;
            if (e2.detail.date) {
              let options2 = getSchedules(e2.detail.date, calendar);
              let appoinment = page.querySelector("#appoinment");
              appoinment.enableTimes(options2);
            }
            break;
          case "submitappoinment":
            console.log(e2.detail.click);
            if (e2.detail.click === "cancel-lead") {
              store.dispatch(setStage("action/close"));
            }
            if (e2.detail.click === "appoinment-form") {
              console.log("Submitting appoinment form", e2.detail.lead);
              store.dispatch(setStage("action/appoinment"));
              window.location.href = router.pathFor("bye");
            }
            break;
        }
      }
    };
    function handleChange() {
      let previousValue = currentValue2;
      currentValue2 = store.getState();
      if (previousValue !== currentValue2) {
        homeUpdater(previousValue, currentValue2);
      }
    }
    page.eventsToListen([
      "user:select-lang",
      "user:select-theme",
      "viewedelement",
      "leavingapp",
      "leavedapp",
      "app-click",
      "date-selected",
      "submitappoinment"
    ], pageEvents);
    store.subscribe(handleChange);
  }

